import ""
import searchIcon from "./images/search_icon.svg";
import arrowDown from "./images/arrow-down.png";

const Inputs = () => {
    return ( 
        <section>
          <div className="input">
            <input type="text" placeholder="Search by book name" className="search__input" />
            <img id="arrow_up" className="search__icon" src={searchIcon} alt="arrow-up" height="25px" />
          </div>

          <div className="price">
            <input type="text" placeholder="Price" className="choose__prise__input" />
            <img id="arrow-down" className="arrow_down" src={arrowDown} alt="arrow-down" height="25px" />
          </div>
        </section>
     );
}

export default Inputs;
